# Method for generating lower LoD

import math 

# Set range of grid
xcoords = [-23.82,23.65]
ycoords = [0.48,52.04]
zcoords = [-0.65,45.94]

# Define number of boxes in each dimension
xboxes = 6
yboxes = 8
zboxes = 6

# Find the control points in a box
def findpts(points,minx,maxx,miny,maxy,minz,maxz):
    cluster = []
    found = []
    for point in points:
        if minx<=point[0]<=maxx and miny<=point[1]<=maxy and minz<=point[2]<=maxz:
            cluster.append(point)
            found.append(point)
    return cluster,found

# Interpolate between given points
def interpolate(point1,point2):
    newpoint = []
    for dim in range(3):
        newpoint.append((point1[dim]+point2[dim])/2)
    return newpoint

# Score points based on how far away they are from the midpoint of the object
# (measuring how extreme the point is indicates how important it is)
def scorepoint(point,midpoint):
    score = abs(point[0]-midpoint[0])+abs(point[1]-midpoint[1])+abs(point[2]-midpoint[2])
    return score

# Get distance between two points
def dist(point1,point2):
    distance = 0
    for dim in range(3):
        distance+= math.sqrt(abs(point1[dim])+abs(point2[dim]))
    return distance

# Calculate new control points of lower LoD
def lod(ctrlpts,xcoords,ycoords,zcoords,xboxes,yboxes,zboxes):
    # Calculate the intervals between boxes
    xinterval = (xcoords[1]-xcoords[0])/xboxes
    yinterval = (ycoords[1]-ycoords[0])/yboxes
    zinterval = (zcoords[1]-zcoords[0])/zboxes

    # Find the midpoint of the object
    xmid = (xcoords[0]+xcoords[1])/2
    ymid = (ycoords[0]+ycoords[1])/2
    zmid = (zcoords[0]+zcoords[1])/2
    midpoint = [xmid,ymid,zmid]

    # Add all control points to a list of points not yet found
    notfound = []
    for i in range(len(ctrlpts)):
        for point in ctrlpts[i]:
            if point not in notfound:
                notfound.append(point)

    # Find control points for all boxes
    clusters = []
    # For each box
    for i in range(xboxes):
        for j in range(yboxes):
            for k in range(zboxes):
                # Find the control points it contains
                cluster,found = findpts(notfound,xcoords[0]+i*xinterval,xcoords[0]+(i+1)*xinterval,ycoords[0]+j*yinterval,ycoords[0]+(j+1)*yinterval,zcoords[0]+k*zinterval,zcoords[0]+(k+1)*zinterval)
                clusters.append(cluster)
                # Update the list of control points not yet found
                for point in found:
                    notfound.remove(point)

    # Keep track of old and new control points
    oldpoints = []
    newpoints = []

    # Find new control points for each box
    for cluster in clusters:
        # Interpolate points in boxes with only 2 points
        if len(cluster)==2:
            point = interpolate(cluster[0],cluster[1])
            oldpoints.append(cluster[0])
            oldpoints.append(cluster[1])
            newpoints.append(point)
            newpoints.append(point)
        # Find which points to interpolate in boxes with more than 2 points
        elif len(cluster)>2:
            # Find scores of all control points in box
            scores = []
            for i in range(1,len(cluster)):
                scores.append(scorepoint(cluster[i],midpoint))
            # Find the points at the greatest extremes in the box
            # (closest to and furthest away from the origin)
            minscore = min(scores)
            maxscore = max(scores)
            diffs = []
            # Find the point furthest away from the extremes
            # (this will be the least influential point)
            for score in scores:
                diffs.append(min(maxscore-score,score-minscore))
            maxdiff = max(diffs)
            # Find the location of this point
            for i in range(len(diffs)):
                if diffs[i] == maxdiff:
                    worstpoint = i
                    break
            # Find control point in box closest to least influential point
            mindist = 1000
            otherpt = 0
            for i in range(len(cluster)):
                if i!=worstpoint:
                    distance = dist(cluster[worstpoint],cluster[i])
                    if distance<mindist:
                        mindist = distance
                        otherpt = i
            # Find new point by interpolation
            point = interpolate(cluster[worstpoint],cluster[otherpt])
            oldpoints.append(cluster[worstpoint])
            oldpoints.append(cluster[otherpt])
            newpoints.append(point)
            newpoints.append(point)

    # Update control points
    newcontrols = []
    for line in ctrlpts:
        newline = []
        for point in line:
            if point in oldpoints:
                # Exchange each old point with new interpolated point
                for i in range(len(oldpoints)):
                    if oldpoints[i] == point:
                        newline.append(newpoints[i])
            else:
                newline.append(point)
        newcontrols.append(newline)

    return newcontrols


# 2nd LoD

# Generate new LoD control points
newcontrols = lod(ctrlpts,xcoords,ycoords,zcoords,xboxes,yboxes,zboxes)

